import React from 'react';
import { BrowserRouter, Route, Switch } from 'react-router-dom';

import './App.css';
import Home from './Tabs/home';
import About from './Tabs/about';
import UserInstructions from "./Tabs/instructions";


function App() {
  return (
    <div>

    <div className= "block1">

      <div className= "cell1">1</div>
      <div className= "cell2">2</div>
      <div className= "cell3">3</div>
      <div className= "cell4">4</div>
      <div className= "cell5">5</div>
      <div className= "cell6">6</div>
      <div className= "cell7">7</div>
      <div className= "cell8">8</div>
      <div className= "cell9">9</div>
    </div>
      <BrowserRouter>

      <Switch>
            <Route path="/" component={Home} exact/>
            <Route path="/home" component={Home} exact/>
            <Route path="/About" component={About}/>
            <Route path="/instructions" component={UserInstructions}/>
      </Switch>


      </BrowserRouter>

    </div>


  );
}

export default App;
